/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "redis"
    }}>{`Redis`}</h1>
    <h2 {...{
      "id": "tldr"
    }}>{`tl;dr`}</h2>
    <h3 {...{
      "id": "hash-sets"
    }}>{`Hash Sets`}</h3>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Command`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Function`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Example`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`HGETALL`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Get all fields and values in hash`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`HGETALL coin:btc`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`HKEYS`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Get all fields in hash`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`HKEYS coin:btc`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`HGET`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Get value of hash field`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`HGET coin:btc id`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`HMGET`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Multiple get value of hash field`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`HGET coin:btc id buy sell`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`HSET`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Set value of hash field`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`HSET coin:btc id 1234`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`HMSET`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Multiple set value of hash field`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`HSET coin:btc id ID1234 buy 123 sell 100`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "lists"
    }}>{`Lists`}</h3>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Command`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Function`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Example`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`RPUSH`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Push elements onto a list`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`RPUSH list "one"`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`LPOP`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Pop element from last on list`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`LPOP list`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`LLEN`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Get list length`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`LLEN list`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "run-local-server-and-attach"
    }}>{`Run local server and attach`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-shell"
      }}>{`# terminal one
redis-server /usr/local/etc/redis.conf
# terminal two
redis-cli
`}</code></pre>
    <h2 {...{
      "id": "command-list"
    }}>{`Command list`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Function`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Command`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Install`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`brew install redis`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Run server`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`redis-server /usr/local/etc/redis.conf`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Uninstall`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`brew uninstall redis && rm ~/Library/LaunchAgents/homebrew.mxcl.redis.plist`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Info`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`brew info redis`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Run Redis CLI client`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`redis-cli`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "redis-commands"
    }}>{`Redis commands`}</h2>
    <p>{`A full list can be found at `}<a parentName="p" {...{
        "href": "https://redis.io/commands"
      }}>{`https://redis.io/commands`}</a>{`.`}</p>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
